import { Box, Typography, List, Divider, } from "@mui/material"
import { CustomList } from "./";

const Planner = ({ itemList }) => {
    return (
        <Box sx={{ width: '30%', margin: 'auto', display: 'flex', bgcolor: 'background.default', borderRadius: '12px' }}>
            <Box id="Meals" sx={{ bgcolor: 'background.paper', width: '100%', display: 'flex', flexDirection: 'column', color: 'text.primary', margin: '2rem', borderRadius: '10px' }}>
                <Typography varient="h2" component="h2" align="center" sx={{ color: 'white', fontWeight: 'bold', fontSize: '2rem' }} color="primary.light" >Meals</Typography>
            </Box>
            <Box id="Upcoming Plans" sx={{
                bgcolor: 'background.paper',
                width: '100%', display: 'flex',
                flexDirection: 'column',
                color: 'text.primary',
                margin: '2rem',
                borderRadius: '10px'
            }}>
                <Typography varient="h2" component="h2" align="center" sx={{ color: 'white', fontWeight: 'bold', fontSize: '2rem' }} color="primary.light" >Upcoming Plans</Typography>
                <CustomList item={itemList} />
            </Box>

        </Box>
    )
}

export default Planner
